import React from 'react';
import './Reports.css';

const Reports = () => {
  return (
    <div className="reports">
      <h1>Reports</h1>
      <div className="reports-content">
        <p>Reports and analytics interface coming soon...</p>
      </div>
    </div>
  );
};

export default Reports;
